import os
import csv
import datetime
from typing import List, Dict
from dataclasses import dataclass

@dataclass
class Error:
    message: str
    code: int

class ErrorMessageUploader:
    def __init__(self, error_messages: List[Error]):
        self.error_messages = error_messages

    def validate_error_messages(self) -> List[Error]:
        valid_error_messages = []
        for error in self.error_messages:
            if error.message and error.code:
                valid_error_messages.append(error)
        return valid_error_messages

    def upload_error_messages(self, valid_error_messages: List[Error]) -> None:
        # Upload valid error messages to the system
        for error in valid_error_messages:
            print(f"Uploading error message: {error.message}, Code: {error.code}")

class BrokerValidationRuleUpdater:
    def __init__(self, rules: List[Dict]):
        self.rules = rules

    def update_broker_validation_rule_table(self) -> None:
        # Update the broker validation rule table in the database
        for rule in self.rules:
            print(f"Updating rule: {rule['rule_name']}, Description: {rule['description']}")

class DUNSValidator:
    def __init__(self, duns_numbers: List[str]):
        self.duns_numbers = duns_numbers

    def perform_duns_validations(self) -> List[str]:
        valid_duns_numbers = []
        for duns in self.duns_numbers:
            # Validate DUNS number
            if self.is_valid_duns(duns):
                valid_duns_numbers.append(duns)
        return valid_duns_numbers

    def is_valid_duns(self, duns: str) -> bool:
        # Validate DUNS number
        # For this example, we'll assume a valid DUNS number is 9 digits long
        return len(duns) == 9 and duns.isdigit()

class FileValidator:
    def __init__(self, file_path: str):
        self.file_path = file_path

    def validate_file(self) -> str:
        # Check if the file has a valid extension
        if not self.file_path.endswith(('.csv', '.txt')):
            return "Invalid file extension. Only .csv and .txt files are allowed."
        return "File is valid."

class DuplicateTransactionPreventer:
    def __init__(self, transactions: List[Dict]):
        self.transactions = transactions

    def prevent_duplicate_transactions(self) -> List[Dict]:
        unique_transactions = []
        for transaction in self.transactions:
            if transaction not in unique_transactions:
                unique_transactions.append(transaction)
        return unique_transactions

