class FABSSubmissionErrorGetter:
    def __init__(self, submissions: List[Dict]):
        self.submissions = submissions

    def get_fabs_submission_errors(self) -> List[Dict]:
        errors = []
        for submission in self.submissions:
            # Get errors for each submission
            if 'errors' in submission:
                errors.append(submission['errors'])
        return errors

